import Header from '../components/Header'
import Calendar from 'react-calendar';

const ReactCalendar = () => {
    const [date, setDate] = useState(new Date());

    const onChange = date => {
        setDate(date);
    };

    return (
        <div>
            <Header />
            <h2>Home Page</h2>
            <Calendar onChange={onChange} value={state.date}/>
        </div>
    )
};
